import React from 'react';
import git from '../git.svg';

const Footer = (props) => {
  return (
 <div class="flex">
  <div class="outline w-25 pa3 mr2">
    <div className="tc w-20 h-20 ">
		<span><a href="#top"><img src={git} /></a></span><h3>Lets Connect</h3>
    </div>
  </div>
  <div class="outline w-25 pa3 mr2">
    <code>2</code>
  </div>
  <div class="outline w-25 pa3 mr2">
    <code>
    <span><a href="#top"><img src={git} /></a></span><h3>Lets Connect</h3>
	</code>
  </div>
  <div class="outline w-25 pa3 mr2">
    <code>4</code>
  </div>
  <div class="outline w-25 pa3">
    <code>5</code>
  </div>
</div>

	)
}

export default Footer;
